Exercise 9.2

'product' is ~= associative property. Created law to represent that. Product and map are also interesting together, in that, the result of either mapping first or mapping over he product doesn't matter
 a.map(f) ** b.map(g) == (a ** b) map { case (a,b) => (f(a), g(b)) }

